const BASE_URL = 'http://localhost:5000/api/nodes';

export const completeNode = async (nodeId, score) => {
  try {
    const response = await fetch(`${BASEURL}/${nodeId}/complete`, {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({ completedScore: score }),
    });

    if (!response.ok) {
      const errorData = await response.json();
      throw new Error(`Failed to complete node: ${errorData.message || response.statusText}`);
    }
    return response.json();
  } catch (error) {
    console.error("Error in completeNode:", error.message);
    throw error;
  }
};
